drop table if exists hk_airline;
create table hk_airline
(
    ID        int auto_increment
        primary key,
    FULLNAME  varchar(255) null,
    SHORTNAME varchar(255) null,
    ICAO      varchar(255) null,
    IATA      varchar(255) null,
    CALLSIGN  varchar(255) null,
    URL       varchar(255) null
);

drop table if exists hk_airport;
create table hk_airport
(
    ID               int auto_increment
        primary key,
    TZ               varchar(255) null,
    IATA             varchar(255) null,
    ICAO             varchar(255) null,
    FRIENDLYNAME     varchar(255) null,
    FRIENDLYLOCATION varchar(255) null,
    LONGITUDE        double       null,
    LATITUDE         double       null
);

drop table if exists hk_fleet;
create table hk_fleet
(
    ID         bigint auto_increment
        primary key,
    FLEET      varchar(255) null,
    ISACQUIRED tinyint(1)   null
);



drop table if exists hk_flight;
CREATE TABLE `hk_flight` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
